良質な果実を、収穫した時のみずみずしさそのままにソフトなゼリーの中にギュッと閉じ込めました。<br>さわやかな季節に、心に残る美味しさです。<br>温暖で肥沃な大地でしっかりと育った温州みかんを使用しています暖かく懐かしい甘さと引き締まった酸味のバランスが絶妙です。<br>ソフトでシンプルなゼリーでやさしく包み込んだ、フルーツそのままの味を楽しめるフルーツゼリーです。<br>【原材料】<br>みかん、砂糖・果糖ぶどう糖液糖、りんご果汁、寒天、洋酒：ゲル化剤(増粘多糖類)、酸味料、香料、酸化防止剤(ビタミンC)<br>※保存方法：直射日光・高温多湿をさけて保存してください。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：株式会社たらみ<br>シリーズ名：PURE<br>内容量：270g<br>アレルギー物質：りんご<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>4955129019463 SH4956 sh4956 PURE pure ふるーつ フルーツ ソフトなゼリー シンプルなゼリー 甘い 酸味 温州みかん フルーツゼリー みかん ミカン リンゴ りんご たらみ 株式会社たらみ お菓子 おかし みかんゼリー 果実 みかんゼリー ゼリー ぜりー おやつ 果実 でざーと デザート 300g 高級フルーツ 高級ふるーつ デザート でざーと くだもの 果物 クダモノ たらみ 株式会社たらみ お菓子 おかし</font></td></tr></table><style type="text/css">
